import React, { useState } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { DataGrid } from '@mui/x-data-grid';
import { rows } from './MockData';
import '../Css/ShopsPage.css'

export default function PresentationLayer() {

  return (
    <Box sx={{ padding: '20px' }}>
      <Box sx={{ display: 'flex', padding: '10px' }}>
        <TextField
          id="searchShop"
          label="Search for shop"
          fullWidth
        ></TextField>
        <TextField
          id="searchInventory"
          label="Select for inventory"
          fullWidth
          sx={{ marginLeft: '10px' }}
        ></TextField>
      </Box>

      <Box sx={{ display: 'flex', justifyContent: 'center', marginTop: '30px' }}>
        <button style={{ padding: '10px 20px', borderRadius: '7px' }}>search</button>
      </Box>


      <Box sx={{ marginTop: '30px' }}>
        <DataGrid
          rows={rows}
          columns={[
            { field: 'id', headerName: 'ID', width: 500 },
            { field: 'shop', headerName: 'Shop', width: 500 },
            { field: 'inventory', headerName: 'Inventory', width: 500 },
            { field: 'products', headerName: 'Products', width: 500 }
          ]}
          checkboxSelection
        ></DataGrid>
      </Box>
      <div>
        <div className='title'>
          <p>hi i am raj</p>
        </div>
      </div>

    </Box>
  );
}
